import React from "react";
import Nav from "./Navbar";
import Hero from "./Hero";
import Port from "./Portfolio";
import Portgrid from "./Portgrid";
import Foot from "./Footer";
import './css/styles.css';
import './assets/img/portfolio/cabin.png';
import "./assets/img/portfolio/cake.png";
import"./assets/img/portfolio/circus.png";
import"./assets/img/portfolio/game.png";
import"./assets/img/portfolio/safe.png";
import"./assets/img/portfolio/submarine.png";



const App = () => {
  return (
    <div>
      <Nav />
      <Hero />
      <Port />
      <div className="grid-items">
        <Portgrid media={"./assets/img/portfolio/cabin.png"} />
        <Portgrid media={"./assets/img/portfolio/cake.png"} />
        <Portgrid media={"./assets/img/portfolio/circus.png"} />
        <Portgrid media={"./assets/img/portfolio/game.png"} />
        <Portgrid media={"./assets/img/portfolio/safe.png"} />
        <Portgrid media={"./assets/img/portfolio/submarine.png"} />
      </div>
      <Foot />
    </div>
  );
};

export default App;
